import { createMuiTheme } from '@material-ui/core/styles'

const theme = createMuiTheme({
    palette: {
        primary: {
            light: '#7c9933',
            main: '#5C8001',
            dark: '#405900',
            contrastText: '#fff',
        },
        secondary: {
            light: '#ffffa3',
            main: '#e1dd72',
            dark: '#adab43',
            contrastText: '#000',
        },
        tertiary: {
            light: '#4d935f',
            main: '#1b6535',
            dark: '#003a0e',
            contrastText: '#fff',
        },
        type: 'dark',
    },
    typography: {
        fontFamily: 'roboto',
        fontSize: 16,
    },
})

export default theme
